import React from "react";
import './Styles.css';
import Lupa from "../../images/lupa.svg";


const [barValue, setVarValue] = useState('');
const changeValue=(e)=>{
    setVarValue(e.target.value);
}

const Header = () => {
    return(
        <header>
            <span>Logo</span>
            <div className="search-area">
                <input type="text" 
                className="search-bar"
                onChange={changeValue}
                value={barValue || ''} />
                <button className="search-btn"><img src={Lupa} /></button>
            </div>
            <button>A</button>
        </header>
    )
}

export default Header;
